import "./profile.css";
import TopBar from "../../components/topbar/TopBar";
import SideBar from "../../components/sidebar/SideBar";
import RightBar from "../../components/rightbar/RightBar";
import Feed from "../../components/feed/Feed";
import { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";

const Profile = () => {
  const [user, setUser] = useState([]);

  useEffect(() => {
    const fetchUser = async () => {
      try {
        const res = await axios.get(`/users/?username=Zoki`);
        setUser(res.data);
      } catch (error) {
        console.error(error);
      }
    };
    fetchUser();
  }, []);

  return (
    <>
      <TopBar />
      <div className="profile">
        <SideBar />
        <div className="profileRight">
          <div className="profileRightTop">
            <img src="/assets/post/4.jpeg" alt="" className="showcaseImage" />
            <div className="profileInfoContainer">
              <img
                src="/assets/person/4.jpeg"
                alt=""
                className="profilePageImage"
              />
              <div className="nameContainer">
                <p className="userNameText">{user.username}</p>
                <p className="userDescText">
                  My name is {user.username}. I'm a photographer.
                </p>
                <p className="userDescText">
                  <b>My camera:</b> {user.camera}
                </p>
              </div>
            </div>
          </div>
          <div className="profileRightBottom">
            <Feed username="zoki" />
            <RightBar user={user} />
          </div>
        </div>
      </div>
    </>
  );
};

export default Profile;
